using System.Collections.Generic;
using System.Linq;

namespace AoC2018
{
    class Day5
    {
        public string CalcA()
        {
            string input = "";
            var data = input.ToList();

            return CalcS(data).ToString();
        }

        private static int CalcS(List<char> data)
        {
            bool hasChanged;
            List<char> upper = data.Select(char.ToUpper).ToList();
            do
            {
                hasChanged = false;
                for (int i = 1; i < data.Count; i++)
                    if (data[i] != data[i - 1] && upper[i] == upper[i - 1])
                    {
                        hasChanged = true;
                        data.RemoveRange(i - 1, 2);
                        upper.RemoveRange(i - 1, 2);
                    }
            } while (hasChanged);

            return data.Count;
        }

        public string CalcB()
        {
            var input = "";

            int leastNum = int.MaxValue;
            foreach (var test in input.ToLower().Distinct())
            {
                var data = input.Where(i => char.ToLower(i) != test).ToList();
                var num = CalcS(data);
                if (num < leastNum)
                    leastNum = num;
            }

            return leastNum.ToString();
        }
    }
}